import React, { Component } from 'react';

class About extends Component{
    render(){
        return (
            <section className="about-container">
                <h3>Hello! <p>A little about <span className="ff-s">me</span> .</p></h3>
                <div className="about-desc">
                    I'm a hybrid between a full-stack dev (with a main focus in front-end) and a designer. I graduated from San Jose State University with a bachelor's in a Software Engineering degree. 
                    <p>Located in California.</p>
                <p>I'm a full-stack developer and UI/UX designer hybrid! I specialize more on front-end but am also open to opportunities to work on back-end.</p>
                <p>Currently a Web Developer working at <b>Expedia</b>.</p>
                <p>Enjoys <b>coding</b>, <i>drawing</i>, <u>designing</u>, taking photos, games and puzzles </p>
                <p>Focusing on web/mobile responsive app development and product design.</p>
                </div>
            </section>
        )
    }
}

export default About;
